import React from 'react';
import { Flex, Button, Text } from '@chakra-ui/core';

export default function Start(props: any) {
  return (
    <Flex width={['100%']} height={['100vh']} align="center" justify="center">
      <Flex align="center" justify="center" flex="column">
        <Text>Try to beat the high score!</Text>
        <Button
          onClick={() => props.setView('play')}
          variantColor="teal"
          variant="outline"
        >
          Start
        </Button>
      </Flex>
    </Flex>
  );
}
